import Container from '../../components/Container';
import Head from 'next/head';

const Index = () => {
  return (
    <>
      <Head>
        <title>Home</title>
      </Head>
      <Container>
        <h1>Index</h1>
      </Container>
    </>
  );
};

export default Index;
